import React from "react";
import days from "../6plates";

function Shedule() {
  return (
    <div className="note">
      <h1>This is the note title</h1>
      <p>Gmail is a free email service provided by Google. As of 2019, it had 1.5 billion active users worldwide. A user typically accesses Gmail in a web browser or the official mobile app. Google also supports the use of email clients via the POP and IMAP protocols.</p>
    </div>
  );
}

export default Shedule;
